import React, { useState } from "react";

const Pistols = (props) => {
  const [pistolData, setPistolData] = useState([]);

  console.log("pistols:", props.fullData.documents);

  for (const element of props.fullData.documents) {
    setPistolData((prevState) => [...prevState, element]);
  }

  return <div className="pistol-Card"></div>;
};

export default Pistols;
